import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';

function first() {
  return (
    <Router>
      <div className="flex flex-col items-center justify-center min-h-screen bg-gray-100 p-4">
        <div className="relative text-center mb-8">
          <h1 className="text-4xl sm:text-5xl md:text-6xl lg:text-7xl font-bold text-blue-600">
            <span className="block transform -rotate-12">Happy</span>
            <span className="block transform rotate-12">24th Anniversary</span>
          </h1>
        </div>

        <img
          src="https://via.placeholder.com/400"
          alt="Anniversary"
          className="rounded-lg shadow-lg max-w-full h-auto mb-8"
        />

        <Link to="/another-endpoint">
          <button
            className="bg-blue-600 text-white py-2 px-6 rounded-full text-xl transition hover:bg-blue-800 fixed bottom-4"
          >
            Let's Start
          </button>
        </Link>

        {/* Routes */}
        <Switch>
          <Route path="/another-endpoint">
            <AnotherPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function AnotherPage() {
  return (
    <div className="flex justify-center items-center h-screen bg-green-100">
      <h2 className="text-4xl">Welcome to the Another Page!</h2>
    </div>
  );
}

export default App;
